import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';

const LoginPage = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const history = useHistory();

  const handleLogin = () => {
    // Kullanıcı girişi kontrolü ve işlemlerini burada yapabilirsiniz.
    // Örneğin, kullanıcı adı ve şifreyi doğrulayabilir ve giriş başarılıysa ana sayfaya yönlendirebilirsiniz.
    // Bu örnekte, sadece bir örnek işlem yaptığımızı unutmayın.

    if (username === 'kullanici' && password === 'sifre') {
      // Kullanıcı adı ve şifre doğru ise ana sayfaya yönlendir.
      history.push('/');
    } else {
      // Kullanıcı adı ve şifre yanlışsa hata mesajını göster.
      alert('Kullanıcı adı veya şifre hatalı.');
    }
  };

  return (
    <div>
      <h1>Login Page</h1>
      <input
        type="text"
        placeholder="Kullanıcı Adı"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
      />
      <input
        type="password"
        placeholder="Şifre"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
      />
      <button onClick={handleLogin}>Giriş Yap</button>
    </div>
  );
};

export default LoginPage;
